import React from "react";
import css from "./style.module.css";
import ProductControl from "./ProductControl";
const Index = (props) => {
  return (
    <div>
      <div className="form-group">
        <label htmlFor="exampleInputId">Барааны линк:</label>
        <input
          name="id"
          id="exampleInputId"
          type="text"
          className="form-control"
          placeholder="Барааны линк"
          autoComplete="off"
        />
        <p className={css.errorMsg}></p>
      </div>
      <div className="form-group">
        <label htmlFor="exampleInputPassword1">Барааны нэр:</label>
        <input
          name="name"
          type="name"
          className="form-control"
          placeholder="Барааны нэр"
          autoComplete="off"
        />
        <p className={css.errorMsg}></p>
      </div>

      <div className="form-group">
        <label>Барааны төрөл:</label>
        <select
          name="type"
          // value={props.product.type}
          // onChange={(event) => {
          //   props.handleInputChange(event);
          // }}
          className="form-control"
        >
          <option value=""></option>
          {/* {props.productTypes.map((el) => {
            return (
              <option key={el.id} value={el.id}>
                {el.name}
              </option>
            ); */}
        </select>
        <p className={css.errorMsg}>
          {/* {props.errorMsg.type.show && props.errorMsg.type.message} */}
        </p>
      </div>
      <div className="form-group">
        <label>Барааны үнэ:</label>
        {/* <input type="number" value={props.product.price} min="0" name="price" className="form-control" onChange={(event) => { props.handleInputChange(event) }} placeholder="Барааны үнэ" autoComplete="off"/> */}
        <div className={css.productPrice}>
          <div class="col-md">
            <input
              name="price"
              // value={props.product.price}
              // onChange={(event) => {
              //   props.handleInputChange(event);
              // }}
              type="number"
              placeholder="үндсэн үнэ юань"
              autoComplete="off"
              min="0"
            ></input>
            <p className={css.errorMsg}>
              {/* {props.errorMsg.price.show && props.errorMsg.price.message} */}
            </p>
          </div>
          <div class="col-md">
            <input
              name="price1"
              // value={props.product.price1}
              type="number"
              // onChange={(event) => {
              //   props.handleInputChange(event);
              // }}
              placeholder="барааны нэмэлт зардал%"
              autoComplete="off"
              min="0"
            ></input>
            <p className={css.errorMsg}>
              {/* {props.errorMsg.price1.show && props.errorMsg.price1.message} */}
            </p>
          </div>
          <div class="col-md">
            <input
              name="price2"
              disabled="true"
              // value={props.product.price1}
              type="number"
              // onChange={(event) => {
              //   props.handleInputChange(event);
              // }}
              placeholder="Нийт"
              autoComplete="off"
              min="0"
            ></input>
            <p className={css.errorMsg}>
              {/* {props.errorMsg.price1.show && props.errorMsg.price1.message} */}
            </p>
          </div>
        </div>
      </div>
      <div className="input-group">
        <div className="custom-file">
          <input
            type="file"
            name="image"
            // onChange={(event) => {
            //   props.handleInputChange(event);
            // }}
            id="exampleInputFile"
          />
          <label
            className="custom-file-label"
            id="exampleInputFileLebel"
            htmlFor="exampleInputFile"
          >
            Зураг сонгох...
          </label>
        </div>
      </div>
      <div className="form-group">
        <label htmlFor="exampleInputPassword1">Барааны өнгөнүүд:</label>
        <input
          name="name"
          type="name"
          className="form-control"
          placeholder="Барааны өнгөнүүд"
          autoComplete="off"
        />
        <p className={css.errorMsg}></p>
      </div>

      <div className="form-group">
        <label htmlFor="exampleInputPassword1">Барааны хэмжээ:</label>
        <input
          name="name"
          type="name"
          className="form-control"
          placeholder="Барааны хэмжээ"
          autoComplete="off"
        />
        <p className={css.errorMsg}></p>
      </div>
      <ProductControl></ProductControl>
    </div>
  );
};

export default Index;
